script: |
  super -f text -I q6152.spq | sort > q6152.out

inputs:
  - name: q6152.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE + 51 NOT IN ( + col1 * + - col1 * - ( + col1 ) - - - 49, + 70 );
  - name: tab1

outputs:
  - name: q6152.out
    data: |
      51	14	96
      85	5	59
      91	47	68
